import Login from './Login';
import './App.css';
import Main from './Main';
import Test from './test';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
const App=() =>{
  return (
    <div className='App'>
      <Router>
        <Routes>

          <Route path="/" element={<Login />} />
        </Routes>
      </Router>
    </div>
  )
}

export default App;
